function Paragrafos() {
  return (
    <>
      <div className="row bg-primary" id="teste"> 
        <div className="col-2"></div>
        <div className="col-8 align-center text-white">
          <h1 className="text-white">Todos os projetos integrados das ETE's Conectados em um só Lugar</h1>
          <div style={{ marginBottom: '20px' }}></div>
          <p className="text-white">
          style={{ fontWeight: 'bold' }} // Adicionando negrito aqui
            O Repositório conect ETE PE é uma base de dados online que objetiva reunir, de forma organizada e acessível, a produção científica e documental das ETE'S de toda RMR
            <br /> com o intuito de torná-la acessível aos pesquisadores e ao grande público nacional e internacional.</p>
        </div>
      </div>
    </>
  );
}

export default Paragrafos;
